import { Layout  } from 'antd';
import Header from './header';
import Footer from './footer';
import Carousel from '../components/carousel';
import Card from '../components/card';

const { Content } = Layout;

export default ({ children}) => (
    <Layout>
    <Header />
    <Content>
      <Carousel/>
      <main>
      { children }
    </main>
      
    </Content>
    <Footer />
  </Layout> 
  )
